import { Card, CardContent } from "@/components/ui/card";
import {
  Carousel,
  CarouselContent,
  CarouselItem,
  CarouselNext,
  CarouselPrevious,
} from "@/components/ui/carousel";

export default function DefaultDemo() {
  return (
    <div id="carousel-wrapper" className="w-full max-w-sm mx-auto px-20">
      <Carousel id="carousel" className="w-full" aria-label="Number cards carousel with 5 slides">
        <CarouselContent id="carousel-content">
          {Array.from({ length: 5 }).map((_, index) => (
            <CarouselItem key={index}>
              <div className="p-1">
                <Card className="bg-subtle-bg border-subtle-bg">
                  <CardContent className="flex aspect-square items-center justify-center p-6">
                    <span className="text-4xl font-semibold text-body-text">{index + 1}</span>
                  </CardContent>
                </Card>
              </div>
            </CarouselItem>
          ))}
        </CarouselContent>
        <CarouselPrevious id="carousel-prev" />
        <CarouselNext id="carousel-next" />
      </Carousel>
    </div>
  );
}

